import React from "react";
import resume from "./assets/resume.pdf";

function Resume() {
  return (
    <div>
      <button>
        <a href={resume} download="mason-weiner-resume">
          Download my resume
        </a>
      </button>
    </div>
  );
}

export default Resume;
